import React from 'react';
import Layout from "../../components/userComponents/Layout";
import Jokecard from "../../components/jokeCards";

const jokes = ["Had this one Had this one Had this one Had this one","Had this one Had this one Had this one Had this one","Had this one Had this one Had this one Had this one","Had this one Had this one Had this one Had this one","Had this one Had this one Had this one Had this one","Had this one Had this one Had this one Had this one"]
export default function JokePage() {
    return (
        <Layout
        title='Dad Jokes'
        page="dlj"
        >
           {jokes.map((j,i)=>(
               <Jokecard
               joke={j}
               key={i}
               />
           ))} 
        </Layout>
    )
}
